
import { destroySession } from '@storage/userData'

const errHandler = (err) => {
    console.log("Error: ", err)
}

export let logout = async (req,res) => {

    var results = {}
    try {
        destroySession(req)
        results = { status: 200 }
        return res.end(JSON.stringify(results));

    } catch (err) {
        errHandler(err)
    }

}
